import React from 'react';
import './App.scss';
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";
import {routes} from "./router";

const App = () => {
    let router = <Router>
        <div>
            <Switch>
                {routes.map((route, index) => {
                    console.log("route",route)
                    return    <Route
                        key={index}
                        path={route.path}
                        exact={route.exact}
                        component={route.component}
                    />}
                    )}
            </Switch>
        </div>
    </Router>;
    return (
        <>
            {router}
        </>
    );
}

export default App;
